import classes from "./../../css/Dialogs.module.css";
import { Routes, Route, BrowserRouter, NavLink } from 'react-router-dom';
import Dialog1 from "./Dialog1";
import Dialog2 from "./Dialog2";



const Dialogs = () => {
	return (
		
			<div className={classes.dialogBox}>
				<div>
					<h2>Контакты</h2>
					<div>
						<ul>
							<NavLink to="/dialogs/dialog1"><li>Иван Лох</li></NavLink>
							<NavLink to="/dialogs/dialog1"><li>Сергей Петух</li></NavLink>
							<NavLink to="/dialogs/dialog2"><li>Анальный Зонд</li></NavLink>
							<NavLink to="/dialogs/dialog2"><li>Ректальный Мастер</li></NavLink>
							<NavLink to="/dialogs/dialog2"><li>Сосочный Вибратор</li></NavLink>
						</ul>
					</div>
				</div>
				<div>
					<h2>Чат</h2>
					<div>
						<Routes>
							<Route path="/dialogs/dialog1" element={<Dialog1 />}></Route>
						<Route path="/dialogs/dialog2" element={<Dialog2 />}></Route>
						</Routes>
					</div>
				</div>
			</div>
		
	);
}

export default Dialogs;
